package com.briup.autoKey;

public class AutoBean {
	private int id;
	private String name;
	public AutoBean() {
		// TODO Auto-generated constructor stub
	}
	public AutoBean(int id, String name) {
		super();
		this.id = id;
		this.name = name;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	@Override
	public String toString() {
		return "AutoBean [id=" + id + ", name=" + name + "]";
	}
	
}
